We have two EXCL cap buckets and we are passing a unique variable based on the geo of the user in the LO URL,. I discovered that the override parameter is not working. Whatever cap bucket is on top will determine the variable we pass in the parameter. 

I conducted a test where I logged in via VPN and tested what variable we pass for utm_source based on MD and CA. In both cases we passed the same variable. What was passed was based on what cap bucket was in first position. Need to get this fixed asap as it is throwing off tracking on school side and revenue on our end.

